import axios from "axios";

const SIGNUP = "SIGNUP";

const signup = (data) => {
  const req = axios
    .post("http://localhost:3065/user/signup", data)
    .then((res) => res.data);
};

// export function signup(data) {
//   const req = axios
//     .post("http://localhost:3065/user/signup", data)
//     .then((res) => res.data).then(console.log('post success'))

//   return {
//     type: SIGNUP,
//     payload: req,
//   };
// }

const initialState = {
  isLoggedIn: false,
  myInfo: null,
};

export default function reducer(state = initialState, action) {
  switch (action.type) {
    case SIGNUP:
      return {
        ...state,
        signupSuccess: action.payload,
      };
    default:
      return state;
  }
}
